<!-- JavaScript arguments object web browser release date: IE6 Dec01, ED12 Jul15, FF1.5 Dec05, SF3.1 Apr08, CH2 Jun09, OP7.50 May04. -->
        <td>
         <ul>
          <li>Represents arguments passed into function, not function definition parameters.</li>
          <li>Array-like object (i.e., has <code>length</code> property and numeric index).</li>
          <li><code>arguments[0]</code> represents first argument.</li>
          <li><code>length</code> property returns number of arguments passed into function.</li>
         </ul>
        </td>
       </tr>
       <tr id='arrayDestructuringSyntax'>
        <td>Array Destructuring Syntax</td>
        <td>
         <ul>
          <li>Assign array values to variables.</li>
         </ul>
        </td>
        <td>
         <ul>
          <li>Wherever variable declarations are valid.</li>
         </ul>
        </td>
        <td>
         <ul>
          <li>ED14+, FF38+, CH49+, OP36+. No IE11-, SF5.1.7-.</li>
          <li><a href='/javascript/javascript_reference/array_destructuring_syntax.php'>Array Destructuring Syntax Web Browser Support Test (learnwebcoding.com)</a>.</li>
         </ul>
        </td>
<!-- JavaScript array destructuring syntax web browser release date: IE11 Nov13, ED14 Aug16, FF38 May15, SF5.1.7 May12, CH49 Mar16, OP36 Mar16. -->
        <td>
         <ul>
          <li>Left side of assignment operator is destructuring pattern (i.e., array literal of variable identifiers corresponding to initializer values).</li>
          <li>Right side of assignment operator is initializer (i.e., list of values using array literal syntax).</li>
          <li>Left side variables assigned right side values.</li>
          <li>ECMAScript 2015.</li>
         </ul>
        </td>
       </tr>
       <tr id='arrowFunctionSyntax'>
        <td>Arrow Function Syntax</td>
        <td>
         <ul>
          <li>Shorthand function definition syntax.</li>
         </ul>
        </td>
        <td>
         <ul>
          <li>In place of traditional function syntax wherever functions are valid.</li>
         </ul>
        </td>
        <td>
         <ul>
          <li>ED12+, FF22+, CH45+, OP32+. No IE11-, SF5.1.7-.</li>
          <li><a href='/javascript/javascript_reference/arrow_function_syntax.php'>Arrow Function Syntax Web Browser Support Test (learnwebcoding.com)</a>.</li>
