<!-- JavaScript arrow function syntax web browser release date: IE11 Nov13, ED12 Jul15, FF22 Jun13, SF5.1.7 May12, CH45 Sep15, OP32 Sep15. -->
        <td>
         <ul>
          <li>No own <code>this</code>, <code>super</code>, <code>arguments</code>, and <code>new.target</code> bindings. Rather, values come from closest containing non-arrow function.</li>
          <li>No function internal <code>[[Construct]]</code> method. Therefore, cannot call with <code>new</code> operator and cannot use as constructor.</li>
          <li>Since cannot use as constructor, no constructor <code>prototype</code> property.</li>
          <li>Best suited for functions, not methods.</li>
          <li>ECMAScript 2015.</li>
         </ul>
        </td>
       </tr>
       <tr id='bindMethod'>
        <td><code>bind()</code> Method</td>
