<!-- JavaScript bind() method web browser release date: IE9 Mar11, ED12 Jul15, FF4 Mar11, SF5.1.4 Mar12, CH7 Oct10, OP11.60 Dec11. -->
        <td>
         <ul>
          <li>New (bound) function wraps and typically executes existing (wrapped) function.</li>
          <li>Bound function <code>this</code> value bound to <code>bind()</code> method first argument.</li>
