         </ul>
        </td>
<!-- JavaScript Generator object web browser release date: IE11 Nov13, ED13 Nov15, FF29 Apr14, SF5.1.7 May12, CH39 Nov14, OP26 Nov14. -->
        <td>
         <ul>
          <li>Also known as <code>Generator</code>.</li>
          <li>Returned by <a href='#generatorFunction'>generator function (above)</a>.</li>
          <li>Has <code>next()</code> method that: 1.) executes generator function body code through <code>yield</code> or <code>return</code> statement and then stops execution; 2.) returns object with <code>value</code> property set to <code>yield</code> or <code>return</code> expression value, and <code>done</code> property set to boolean indicating if <code>value</code> property was not set to <code>yield</code> expression value; and 3.) is typically called multiple times until required <code>yield</code> expression values are returned.</li>
          <li>If previous <code>next()</code> reached <code>return</code>, subsequent <code>next()</code> does not execute generator function body code and returns <code>{value: undefined, done: true}</code>.</li>
          <li>If previous <code>next()</code> reached <code>yield</code>, subsequent <code>next()</code>: 1.) executes generator function body code from after stopped <code>yield</code> through <code>yield</code> or <code>return</code> statement and then stops execution; and 2.) returns object with <code>value</code> property set to <code>yield</code> or <code>return</code> expression value, and <code>done</code> property set to boolean indicating if <code>value</code> property was not set to <code>yield</code> expression value.</li>
          <li>If <code>next()</code> does not reach <code>yield</code> or <code>return</code>; 1.) entire/remaining generator function body code is executed, and 2.) current and subsequent <code>next()</code> return <code>{value: undefined, done: true}</code>.</li>
          <li>Not a proper reference type like <code>Date</code>, <code>Object</code>, <code>Array</code>, <code>Function</code>, <code>Map</code>, etc. (i.e., <code>window.Generator</code> property does not exist).</li>
          <li>ECMAScript 2015.</li>
         </ul>
        </td>
