      <tfoot>
       <tr>
        <td colspan='5'>
         <a id='1'></a><a href='#1_return'>(1)</a> The ECMAScript specifications describe the <code>isPrototypeOf()</code> method only on constructor <code>prototype</code> (i.e., prototypes), not also on <code>Object</code> reference type (i.e., objects). That when the <code>create()</code> method was added to the ECMAScript specification, apparently the <code>isPrototypeOf()</code> method was not also described on objects, and that, therefore, apparently web browsers implemented the <code>isPrototypeOf()</code> method on objects independent of ECMAScript, seems odd.<br />
         <a id='2'></a><a href='#2_return'>(2)</a> By default, in FF60+, the about:config | dom.moduleScripts.enabled preference is set to true. By default, in FF54 - 59, the about:config | dom.moduleScripts.enabled preference is set to false. In FF53-, the about:config | dom.moduleScripts.enabled preference does not exist.
        </td>
       </tr>
